      return error();
    }
    return orElse();
  }

  @override
  @optionalTypeArgs
  TResult map<TResult extends Object?>({
    required TResult Function(LikeStateInitialSelected value) initialSelected,
    required TResult Function(LikeStateInitialNotSelected value)
